INSERT INTO `zy_club_info` VALUES ('1', '全国“篮球城市”篮球交流结束 十城市参与活动', '', '华奥星空10月15日电(记者 杨宝岩) 昨天，第十届全国“篮球城市”篮球交流活动在上海市卢湾体育中心圆满结束。', '', '', '', '1544325344', '0'), ('2', 'NBA总裁寄望世界和平 记者问斯特恩：你幸福吗', '', '记者问：下一个15年NBA的目标是什么？', '', '', '', '1544325344', '0'), ('3', '韦德遗憾扣篮没中 詹姆斯：按摩就是想放松一下', '', '华奥星空10月11日北京电(记者 杨宝岩)NBA中国赛第一场比赛在五棵松体育馆举行，热火队以94比80战胜了洛杉矶快船队。在赛后，两队的队员在经过短暂休息后参加了新闻发布会。热火队的韦德和詹姆斯在记者等待了半个小时之后来到发布会现场。', '', '', '', '1544325344', '0'), ('4', '湖人宣布布朗下课 科比加索尔表态：专注现在', '', '华奥星空10月11日北京电(记者 杨宝岩)NBA中国赛第一场比赛在五棵松体育馆举行，热火队以94比80战胜了洛杉矶快船队。在赛后，两队的队员在经过短暂休息后参加了新闻发布会。热火队的韦德和詹姆斯在记者等待了半个小时之后来到发布会现场。', '', '', '', '1544325344', '0'), ('5', '打算大', 'http://tp5.cli.me//uploads/picture/20181217/11f4f5196a55d4d24fe4cc3b9220d2ec.jpg', '撒大dsdasadas', '', '', '', '1545054725', '1');
COMMIT;

