INSERT INTO `zy_hot_news` VALUES ('1', '王治郅谈亚运会 对后辈寄予厚望', '/static/index/images/news1.jpg', '华奥星空北京10月25日电(记者 杨宝岩)晚上7点30分，训练局书记刘文雄', '', '1544327440', '1', '0'), ('2', '男篮U19集训周琦李京龙入选 王怀玉担任主教练', '/static/index/images/news1.jpg', '　　华奥星空10月24日北京电(记者 杨宝岩)今天下午，篮球中心关于组织U19国青男篮集训的通知，王怀玉继续担任U19国青队主教练，助理教练则由张云松和张成担', '', '1544327440', '0', '0'), ('3', '关于举行2012年全国篮球U17集训赛抽签仪式通知', '/static/index/images/news1.jpg', '2012年全国篮球U17集训赛将于2012年9月12日(男子组)和10月12日(女子组)分别在湖北武汉和辽宁丹东进行比赛。根据竞赛规程，', '', '1544891989', '0', '0'), ('4', '2012年全国篮球俱乐部青年联赛第二阶段事宜通知', '/static/index/images/news1.jpg', '各有关省、自治区、直辖市体育局训竞处(管理中心)，总政宣传部文体局：\n\n　　2012年全国篮球俱乐部青年联赛第二阶段比赛将于6月举行，根据第一阶段比赛名次，现将有关事宜通知如下：', '', '1544327440', '0', '0'), ('5', '更新', 'http://tp5.cli.me//uploads/picture/20181216/a378404df8278a481a96671b9bbfb4c4.png', '123456', '', '1544892464', '0', '0'), ('6', 'dasda', 'http://tp5.cli.me//uploads/picture/20181215/79c3c800e5f4e6c32bc5c8648f82faa9.png', 'sadas', '', '1544884577', '0', '0'), ('7', 'dasdas', 'http://tp5.cli.me//uploads/picture/20181215/e29a9ca7747c25a8e64362f65508cb92.png', 'dasdasda', '', '1544884662', '0', '0'), ('8', 'dsa', '', 'das', '', '1544962504', '0', '1'), ('9', '测试标题一', 'http://tp5.cli.me//uploads/picture/20181216/188dd707de32d06933f6c8575c079751.png', '测试标题一的段标题', '', '1544963975', '0', '1'), ('10', '这是我要添加的文章 修改', 'http://tp5.cli.me//uploads/picture/20181216/a222b7395875dffd0e922e1d47dd4b65.png', '这是我要添加的文章 备注', '', '1544964215', '0', '1');
