DROP TABLE IF EXISTS `zy_index_article`;
CREATE TABLE `zy_index_article` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) NOT NULL,
  `content` text NOT NULL,
  `create_time` int(11) NOT NULL,
  `update_time` int(11) NOT NULL,
  `news_id` int(11) NOT NULL,
  `count` int(20) NOT NULL DEFAULT '0',
  `status` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Records of `zy_index_article`
-- ----------------------------
BEGIN;
INSERT INTO `zy_index_article` VALUES ('1', '讲个笑话：', '男孩温柔的对女孩说，傻瓜，你不会做饭不会洗衣服，以后没有我了，你怎么办。女孩为证明自己一个人也可以过的很好，然后，跟男孩分手了。。分手了。。。了。。', '1491570685', '0', '0', '0', '0'), ('2', '奇趣百科1d', '一位上京赶考的穷书生去避雨，巧遇一位姑娘。书生和姑娘吟诗作对，相见恨晚，竟在当晚私定终身。次日，雨过天晴，书生继续赶路，他和姑娘依依惜别，并许诺：“若我得中状元，必定登门迎娶！”姑娘等那书生一走，便将他的姓名记录在册，一边写，一边自言自语道：“十五个了！分散投资，总有一个会考中吧！”', '1545055662', '0', '0', '0', '0'), ('3', '兰亭集序', '永和九年， 岁在癸丑， 暮春之初， 会于会稽山阴之兰亭， 修禊事也。 群贤毕至， 少长咸集。 此地有崇山峻岭， 茂林修竹， 又有清流激湍， 映带左右， 引以为流觞曲水， 列坐其次。 虽无丝竹管弦之盛， 一觞一咏， 亦足以畅叙幽情。\r\n是日也， 天朗气清， 惠风和畅， 仰观宇宙之大， 俯察品类之盛， 所以游目骋怀， 足以极视听之娱， 信可乐也。\r\n夫人之相与， 俯仰一世， 或取诸怀抱， 悟言一室之内； 或因寄所托， 放浪形骸之外。 虽趣舍万殊， 静躁不同， 当其欣于所遇， 暂得于己， 快然自足， 不知老之将至； 及其所之既倦， 情随事迁， 感慨系之矣。 向之所欣， 俯仰之间， 已为陈迹， 犹不能不以之兴怀， 况修短随化， 终期于尽！ 古人云： “死生亦大矣。” 岂不痛哉！\r\n每览昔人兴感之由， 若合一契， 未尝不临文嗟悼， 不能喻之于怀。 固知一死生为虚诞， 齐彭殇为妄作。 后之视今， 亦犹今之视昔。 悲夫！ 故列叙时人， 录其所述， 虽世殊事异， 所以兴怀， 其致一也。 后之览者， 亦将有感于斯文。', '1491571029', '0', '0', '0', '0'), ('4', '变形金刚系列电影十周年，盛典城市由你决定！', '亲爱的变形金刚粉丝们，变形金刚电影迎来十周年，这次超级盛典的举办地将由变形金刚粉丝们自己投票决定！20个候选城市哪个地方的变形金刚粉丝多，这次官方的盛典活动就在哪里举行！！！', '1491571330', '0', '0', '0', '0'), ('5', '最是那一低头的温柔', '恰似水莲花不胜凉风的娇羞', '1491571494', '0', '0', '0', '0'), ('6', '几何智力题', '假如你被关在一个没有门窗，四壁，天花板，地板雪白的房间。房间中只有一支铅笔和一个等腰直角三角形木片。逃出房间的唯一方法是精确地画出一个等边三角形。怎么办?', '1491571657', '0', '0', '0', '0'), ('7', '乐山大佛是世界最大', '世界上还有比乐山大佛更宏伟的建筑吗？', '1491571834', '0', '0', '0', '0'), ('8', '文字和心理', '-听说你学心理学？\r\n-嗯。\r\n-那你知不知道我心里在想什么？\r\n-……\r\n\r\n虽然我不知道你在想什么，但我可以用文字加上原理，给你科普有趣的小知识。', '1491571994', '0', '0', '0', '0'), ('9', 'UMEditor测试', '&lt;p&gt;&lt;strong&gt;实例化UMEditor&lt;/strong&gt;&lt;/p&gt;&lt;hr/&gt;&lt;p&gt;添加表情测试：&lt;img src=&quot;http://img.baidu.com/hi/jx2/j_0024.gif&quot;/&gt;&lt;img src=&quot;http://img.baidu.com/hi/tsj/t_0003.gif&quot;/&gt;&lt;/p&gt;&lt;p&gt;添加图片测试：&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://localhost/MessageBoard/public/static/um/php/upload/20170502/14937147416805.png&quot; style=&quot;&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://localhost/MessageBoard/public/static/um/php/upload/20170502/14937147568048.png&quot; style=&quot;&quot;/&gt;&lt;/p&gt;&lt;p&gt;添加视频测试【MP4格式】：&lt;video width=&quot;300&quot; height=&quot;200&quot; style=&quot;float:none&quot; controls=&quot;&quot; autoplay=&quot;&quot; src=&quot;http://demo.itivy.com/html5-canvas-video/BigBuckBunny_640x360.mp4&quot;&gt;&lt;/video&gt;&lt;/p&gt;', '1493714823', '0', '0', '0', '0'), ('10', 'sadsa', '', '1545055470', '0', '0', '0', '1');
COMMIT;

