INSERT INTO `zy_index_comment` VALUES ('1', '2', '陈独影', '心在莫名的痛！', '1491570856', '0'), ('2', '2', '夜＊凄杀', '书生说：第十五个了。在忽悠几个能在京城买套房了', '1491570877', '0'), ('3', '2', '李白', '擦咧！', '1491571061', '0'), ('4', '2', '杜甫', '小伙子不错呦！', '1491571078', '0'), ('5', '3', '王羲之', 'WTF', '1491571108', '0'), ('6', '1', '白居易', '楼上装逼！', '1491571108', '0'), ('7', '3', '路人甲', '+1', '1491571108', '0'), ('8', '2', '楼主', '变形金刚系列电影十周年盛典城市票选活动官方海报\r\n\r\n所以，请你给自己喜爱的以下20个候选城市进行投票，获得赞数最高的候选城市将有机会举办变形金刚系列电影十周年盛典活动，最终获胜的城市将于2017年第七届北京国际电影节期间公布。此外，参与投票和讨论的用户将有机会参加盛典活动并和主创见面哦。\r\n还等什么？给你心目中最喜欢的候选城市投票吧！\r\n\r\n北京、成都、重庆、福州、广州、哈尔滨、杭州、合肥、济南、南京、上海、深圳、沈阳、石家庄、苏州、天津、武汉、西安、长沙、郑州\r\n\r\n此外，在变形金刚系列电影十周年之际，粉丝们可以通过#我和变形金刚十年#话题参与回帖讨论，写下与变形金刚息息相关的故事，也许源于儿时不可求的玩具，也许是陪伴着成长的动漫，也许是和男女朋友一起去享受的电影时的感情……把你的故事写下来，分享同属于变形金刚粉丝的感动！\r\n\r\n参与投票和参与互动将有机会获得变形金刚正版模型及通兑的电子观影券，我们将在4月5日、4月12日、4月17日公布三批随机抽取的获奖用户名单，每批奖品分别为50张电影票和20个模型~\r\n', '1491571367', '0');
COMMIT;

