--  Records of `zy_news_content`
-- ----------------------------
BEGIN;
INSERT INTO `zy_news_content` VALUES ('1', '1', '<p>　　华奥星空10月24日北京电(记者 杨宝岩)今天下午，篮球中心关于组织U19国青男篮集训的通知，王怀玉继续担任U19国青队主教练，助理教练则由张云松和张成担任。李春江之子李京龙也再次出现在名单上。这个队伍将参加2013年的U19世青赛。</p>\n								<p>　　以下为集训通知全文：</p>\n								<p>　　篮球字〔2012〕516号</p>\n								<p>　　各有关省(市)体育局球类中心、总政宣传部文体局：</p>\n								<p>　　为备战2013年6月27日举行的世界U19青年男篮锦标赛，加强我国篮球后备人才的培养，提高基础训练水平，同时为各俱乐部培养骨干力量，经研究，拟于2012年10月28日至2013年7月7日期间组织U19国青男篮集训。现将集训有关事宜通知如下：</p>\n								<p>　　一、集训阶段划分：(共分为两个阶段)</p>\n								<p>　　第一阶段：2012年10月28日至2013年1月27日结束；1月28日至3月20日队员归队备战全运会预赛。</p>\n								<p>　　第二阶段：2013年3月21日至2013年7月7日结束。</p>\n								<p>　　所有运动员必须按时报到。</p>\n								<p>　　二、U19男篮集训人员名单：</p>\n								<p>　　领 队：张 雄(兼，篮球中心)</p>\n								<p>　　主教练：王怀玉(广东)</p>\n								<p>　　教练员：张 成(江苏)、张云松(北京)</p>\n								<p>　　体能教练兼翻译：徐军海(中央财经大学)</p>\n								<p>　　队 医：杜文亮(体育医院)</p>\n								<p>　　运动员：赵继伟、周琦(辽宁)，杨金蒙、李京龙、邵英伦(广东)，代怀博(新世纪)，李麒(北京)，李斌(浙江广厦)，姚天一(新疆)，白冰、张韩、衡艺丰(江苏)，王玥(佛山)，赵睿(东莞柏宁)，徐煜峰(山东)、刘天意(吉林)。</p>\n								<p>　　三、报到时间、集训地点及联系人：</p>\n								<p>　　(一)报到时间：请于2012年10月28日报到。</p>\n								<p>　　(二)男青报到地点：国家体育总局训练局北公寓(北京市崇文区天坛东路50号)；联系人：张隆(篮球中心) ，18910933053。</p>\n								<p>　　四、经费及其它规定：</p>\n								<p>　　(一)医疗费、人身意外伤害保险费和往返交通费由所属单位支付。</p>\n								<p>　　(二)运动员需自带必须的训练装备和生活用品。</p>\n								<p>　　篮球中心</p>\n								<p>　　2012年10月24日</p>'), ('2', '5', '<p>\r\n	上传图片<span>上传图片</span><span>上传图片</span><span>上传图片</span><span>上传图片</span><span>上传图片</span> \r\n</p>\r\n<p>\r\n	<span><span>上传图片</span><span>上传图片</span><span>上传图片</span><span>上传图片</span></span> \r\n</p>\r\n<p>\r\n	<span><span>上传图片</span><span>上传图片</span></span> \r\n</p>\r\n<p>\r\n	<span><span>上传图片</span><br />\r\n</span> \r\n</p>'), ('3', '6', '<p>\r\n	adsadasdsa\r\n</p>\r\n<p>\r\n	dasdsa\r\n</p>\r\n<p>\r\n	dasdsa\r\n</p>\r\n<p>\r\n	dsadas\r\n</p>'), ('4', '7', 'jdjsjdjsadjjasd'), ('5', '8', 'das'), ('6', '9', '测试标题一的段标题的内容<span>测试标题一的段标题的内容</span><span>测试标题一的段标题的内容</span><span>测试标题一的段标题的内容</span><span>测试标题一的段标题的内容</span>'), ('7', '10', '这是我要添加的文章 内容<span>这是我要添加的文章 内容</span><span>这是我要添加的文章 内容</span><span>这是我要添加的文章 内容</span><span>这是我要添加的文章 内容</span><span>这是我要添加的文章 内容</span><span>这是我要添加的文章 内容</span><span>这是我要添加的文章 内容</span><span>这是我要添加的文章 内容</span><span>这是我要添加的文章 内容 修改</span>');
COMMIT;

