任。李春江之子李京龙也再次出现在名单上。这个队伍将参加2013年的U19世青赛。</p>\r\n								<p>　　以下为集训通知全文：</p>\r\n								<p>　　篮球字〔2012〕516号</p>\r\n								<p>\";s:6:\"is_top\";s:1:\"0\";s:7:\"news_id\";s:1:\"1\";}', '1544890319'), ('2986', '8', '0.0.0.0', '保留地址 保留地址  ', 'Mac', 'Chrome(64.0.3282.167)', '/admin/news_content/index.html', 'admin', 'NewsContent/index', '0', 'a:0:{}', '1544890689'), ('2987', '8', '0.0.0.0', '保留地址 保留地址  ', 'Mac', 'Chrome(64.0.3282.167)', '/admin/news_content/index.html', 'admin', 'NewsContent/index', '0', 'a:0:{}', '1544890694'), ('2988', '8', '0.0.0.0', '保留地址 保留地址  ', 'Mac', 'Chrome(64.0.3282.167)', '/index.php/admin/news_content/edit?id=5', 'admin', 'NewsContent/edit', '0', 'a:1:{s:2:\"id\";s:1:\"5\";}', '1544890697'), ('2989', '8', '0.0.0.0', '保留地址 保留地址  ', 'Mac', 'Chrome(64.0.3282.167)', '/index.php/admin/news_content/', 'admin', 'NewsContent/index', '0', 'a:0:{}', '1544890698'), ('2990', '8', '0.0.0.0', '保留地址 保留地址  ', 'Mac', 'Chrome(64.0.3282.167)', '/admin/image/ajaxuploadimage', 'admin', 'Image/ajaxuploadimage', '0', 'a:2:{s:8:\"Filename\";s:14:\"javascript.png\";s:6:\"Upload\";s:12:\"Submit Query\";}', '1544890718'), ('2991', '8', '0.0.0.0', '保留地址 保留地址  ', 'Mac', 'Chrome(64.0.3282.167)', '/admin/news_content/add', 'admin', 'NewsContent/add', '1', 'a:6:{s:5:\"title\";s:6:\"更新\";s:11:\"small_title\";s:3:\"das\";s:5:\"thumb\";s:80:\"http://tp5.cli.me//uploads/picture/20181216/c9122953d85e437ec32a71982e1fa54c.png\";s:7:\"content\";s:79:\"<p>\r\n	哇哈哈哈哈哈哈哈\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	嘿嘿嘿\r\n</p>\";s:6:\"is_top\";s:1:\"1\";s:7:\"news_id\";s:1:\"5\";}', '1544890725'), ('2992', '8', '0.0.0.0', '保留地址 保留地址  ', 'Mac', 'Chrome(64.0.3282.167)', '/admin/news_content/index.html', 'admin', 'NewsContent/index', '0', 'a:0:{}', '1544890738'), ('2993', '8', '0.0.0.0', '保留地址 保留地址  ', 'Mac', 'Chrome(64.0.3282.167)', '/admin/news_content/index.html', 'admin', 'NewsContent/index', '0', 'a:0:{}', '1544890743'), ('2994', '8', '0.0.0.0', '保留地址 保留地址  ', 'Mac', 'Chrome(64.0.328